Buffet vs. Plated:

Should you treat your wedding guests a plated dinner or let them choose from a variety of options with a buffet?
Plated table service is the most formal while buffet is more laid back casual style.

Here are a few tips to help you decide:

1. Consider your overall theme of your wedding:
black tie, formal or more casual and laid back.

2. A plated dinner can save you money on food cost, but you will pay more for service.

3. You will need to take into consideration budget, guest expectations and your personal preferences.

At the end of the day, your wedding, your way! 

